export default function Mylist() {
    function List1(event) {
        event.preventDefault();
        const goalInput = event.target.name.value;
        const newGoal = new Mylist(goalInput);
        newGoal.render();
    }

    return (
        <div>
            <h2>My List</h2>
            <input type="text" placeholder="Add a goal"></input>
            <button type="submit" onSubmit={List1}>
                Submit
            </button>
        </div>
    );
}
